import React, { Component } from 'react';
import { JsonToTable } from "react-json-to-table";
import mockupdata from "../mockupdata";
import DataTable from 'react-data-table-component';

// render every component for the website
export default class TableSpace extends Component {

    render() {

        //console.log("table space says: ")
        //console.log(this.props.data)

        const columns = [
            {
              name: 'Answer ID',
              selector: 'AnswerID',
              sortable: true,
            },
            {
              name: 'Organization Name',
              selector: 'OrganizationName',
              sortable: true,
            },
            {
              name: 'Organization Desc',
              selector: 'OrganizationDesc',
              sortable: true,
            },
          ];

        return (
            <div id='tableSpace'>
                <DataTable
                    columns={columns}
                    data={mockupdata}
                    pagination
                />
            </div>

            // <div id='tableSpace'>
            //     <JsonToTable json={this.props.data} />
            // </div>
        )
    }
}
